Heres a focused review of the 325px-width screenshots. Ill call out issues and give concrete CSS changes.

---

##  1. Layout overflow
**No obvious horizontal overflow**, but the content feels tight against edges in a couple places.

**Issue:** The main chat bubble and card content are too close to viewport edges, especially on small screens. It feels cramped and risks text touching borders.

**Fix: add padding on the chat bubble container**
```css
.chat-bubble,
.ai-response,
.response-card {
  padding: 16px; /* if already 12px, bump to 16px */
}
```

---

##  2. Touch targets (44px minimum)
The card buttons *look close* to the minimum height but likely dont hit 44px once padding is factored in.

**Issue:** ELITE, FREE (WILD), CHAPTER 2+ buttons look short. They appear around ~3640px tall.

**Fix: enforce minimum height**
```css
.horse-card .btn,
.horse-card button {
  min-height: 44px;
  padding: 10px 14px;
  font-size: 14px;
}
```

---

##  3. Text readability
**Main issue:** Body text inside the chat response feels too small and cramped at 325px width, especially the long paragraph list in the AI response.

**Fix: slightly increase base size and line-height**
```css
.ai-response p,
.ai-response li {
  font-size: 15px;
  line-height: 1.55;
}
```

---

##  4. Chat bubble formatting
**Issue:** The AI response is structured well, but the highlighted card (Arabian {Superior / Elite handling}) feels visually disconnected. The left red bar is nice, but the box is too close to surrounding content and the title block is overly tall due to large font + tight width.

**Fix: tighten header block + spacing**
```css
.ai-response .highlight-card {
  margin: 12px 0 18px;
  padding: 12px 14px;
}
.ai-response .highlight-card h3 {
  font-size: 18px;
  line-height: 1.2;
}
```

---

##  5. Horse cards readability at 325px
**Issue:** The horse card is readable, but the stacked badges/buttons create a tall vertical block with lots of empty space. The stat bars also feel too thin; theyre hard to read at this width.

**Fix: make stat bars thicker + reduce vertical gaps**
```css
.horse-card .stat-bar {
  height: 8px;
}
.horse-card .stats-group {
  gap: 10px; /* reduce if currently larger */
}
.horse-card h4 {
  font-size: 18px;
}
```

---

##  6. Visual bugs
**Issue:** The page has a strong vignette/dark border; at 325px it makes the content feel even narrower. It also looks like the content card has a glow/border that blends into the background.

**Fix: reduce outer shadow or increase content width**
```css
.page-wrapper {
  padding: 12px; /* reduce outer padding if large */
}
.content-panel {
  max-width: 100%;
}
```

---

### Summary of Key Issues
- Buttons likely under 44px height.
- Body text too small for long AI response.
- Highlight card and stat bars need better spacing/thickness.
- The overall layout feels cramped due to edge padding and vignette.

If you can share HTML/CSS class names, I can refine selectors further.
